import React from "react";
import Button from "react-bootstrap/Button";
import { Link } from "react-router-dom";
import { HeaderContainer } from "./Header.css";
import { headerNav } from "./HeaderData";
import { Btn } from "./Header.css";

const Header = () => {

    return (
        <HeaderContainer>
            {headerNav.map((item) => 
                <Link key={item.id} to={item.path}><Btn variant="info">{item.name}</Btn></Link>
            )}
        </HeaderContainer>
    )
}

export default Header;
